56 &lt;/li&gt;\n          &lt;li&gt; Threads: 6144 &lt;/li&gt;\n          &lt;li&gt; Memory: 43.18 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][::2]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"data":{"cpu":{"__ndarray__":"AAAAAAAAGEAAAAAAAAAAQAAAAAAAACRAMzMzMzPzSEAzMzMzMzM5QAAAAAAAABBAmpmZmZm5UUCamZmZmdlYQDMzMzMzs1lAAAAAAAAgWUCamZmZmflXQAAAAAAAAE1AmpmZmZkZMEDNzMzMzMxTQGZmZmZm5kpAzczMzMwMR0BmZmZmZuY1QAAAAAAAAFNAzczMzMzMSkAAAAAAAABOQM3MzMzMzDlAzczMzMxMUkAzMzMzM3NKQAAAAAAAAENAAAAAAAAAOkAzMzMzM3NTQJqZmZmZGUdAAAAAAAAAQ0AAAAAAAAA4QAAAAAAAAFJAAAAAAAAAREAAAAAAAABCQAAAAAAAADZAAAAAAAAATUAAAAAAAABDQAAAAAAAADpAAAAAAAAANkAAAAAAAABEQAAAAAAAADpAAAAAAAAAQEAAAAAAAAAwQAAAAAAAACRAAAAAAAAAMEAAAAAAAAAyQAAAAAAAABhAAAAAAAAAKEAAAAAAAAAoQAAAAAAAACxAAAAAAAAAKEAAAAAAAAAsQAAAAAAAACBAAAAAAAAALEAAAAAAAAAkQAAAAAAAAChAAAAAAAAAKEAAAAAAAAAYQAAAAAAAACxAAAAAAAAAJEAAAAAAAAAsQAAAAAAAACRAAAAAAAAAIEAAAAAAAAAoQAAAAAAAACRAAAAAAAAAIEAAAAAAAAAQQAAAAAAAACBAAAAAAAAAIEAAAAAAAAAkQAAAAAAAABBAAAAAAAAAEEAAAAAAAAAkQAAAAAAAABBAAAAAAAAAIEAAAAAAAAAAQAAAAAAAABhAAAAAAAAAJEAAAAAAAAAQQAAAAAAAABBAAAAAAAAAAEAAAAAAAAAYQAAAAAAAABhAAAAAAAAAEEAAAAAAAAAAAAAAAAAAACBAAAAAAAAAIEAAAAAAAAAYQAAAAAAAABBAAAAAAADAUkAAAAAAAKBWQJqZmZmZGTFAAAAAAAAAEEAAAAAAAAAYQAAAAAAAACRAAAAAAAAAEEAAAAAAAAAYQAAAAAAAABBAzczMzMxMRUBmZmZmZuZYQJqZmZmZeVlAMzMzMzNzWEBmZmZmZgZRQAAAAAAAAEZAAAAAAAAANkCamZmZmZlSQM3MzMzMTE1AmpmZmZkZSEAAAAAAAAA4QDMzMzMz81JAAAAAAADAS0DNzMzMzExHQAAAAAAAADxAzczMzMzMVEAzMzMzMzNKQM3MzMzMDEdAAAAAAAAAQUBmZmZmZsZSQM3MzMzMTEhAzczMzMwMQ0BmZmZmZuY5QM3MzMzMDFFAAAAAAAAAQUAAAAAAAABAQGZmZmZm5jNAZmZmZmYmSEAAAAAAAABAQAAAAAAAADpAAAAAAAAAOEAAAAAAAABBQAAAAAAAADBAAAAAAAAAMEAAAAAAAAAYQAAAAAAAACxAAAAAAAAAMEAAAAAAAAAsQAAAAAAAACBAAAAAAAAALEAAAAAAAAAwQAAAAAAAADBAAAAAAAAAJEAAAAAAAAAkQAAAAAAAACRAAAAAAAAALEAAAAAAAAAkQAAAAAAAACRAAAAAAAAAJEAAAAAAAAAsQAAAAAAAACRAAAAAAAAALEAAAAAAAAAQQAAAAAAAACRAAAAAAAAAJEAAAAAAAAAkQAAAAAAAACRAAAAAAAAAGEAAAAAAAAAoQAAAAAAAAChAAAAAAAAAJEAAAAAAAAAYQAAAAAAAABhAAAAAAAAAJEAAAAAAAAAgQAAAAAAAACRAAAAAAAAAAEAAAAAAAAAYQAAAAAAAACRAAAAAAAAAGEAAAAAAAAAYQAAA
